window.bookSummaryJSON = "<p>Wildcat: a football formation in which the ball is snapped, not to the quarterback, but to another player lined up in the quarterback position. </p> <p>Wild, Cat: a beautiful woman from the sky, who hooked me against the rails, and has me on the ropes. Sweet like honey, with a hint of sass burning behind her pretty brown eyes, she took over my heart without warning. I'm Quinn Bailey, quarterback for the New York Mavericks. Sports analysts predicted I'd break records and take my team all the way. But no one predicted this. And just like the other team, I never saw it coming.</p>"; 
